import React from 'react';
import Input from './inputComponent';
import './ProjetoBase.css';
import './converter';

export default function ProjetoBase() {
  return (
    <div className="container">
      <h2>react-text-transformer</h2>
      <Input id="textoPrincipal" label="Digite um texto aqui"/>
      <h3>Transformações</h3>
      <Input id="invertido" label="Texto invertido" readOnly/>
      <Input id="numerico" label="Texto numérico" readOnly/>
      <Input id="csv" label="Csv" readOnly/>
      <Input id="slug" label="Slug" readOnly/>
      <Input id="vogais" label="Somente vogais" readOnly/>
      <Input id="consoantes" label="Somente consoantes" readOnly/>
      <Input id="variavel" label="Variável" readOnly/>
    </div>
  );
}
